import logo from "../src/aclogo.png";
import NavBar from "./NavBar";

const Home = () => {
    return ( 
        <div className="container">
            <NavBar />
            <div className="home">
                <img src={logo} className="home-logo"/>
                <button>Join The Brotherhood</button>
            </div>
        </div>
     );
}

export default Home;
